import React , {Component} from 'react';

const CommentListItem = ( inputs, fields ) => {
  return (
    inputs.map(inputs => {
      <ul>
        <li>{inputs.author}</li>
        <li>{inputs.commentText}</li>
        <li>{fields.date}</li>
      </ul>
    })

  )
}

export default CommentListItem;
